Q: How to fill out Form I-601?

A: When filling out Form I-601, the Application for Waiver of Grounds of Inadmissibility, you need to provide the following information:
• personal information, including contact information and information on your visa application; 
• information on the grounds of your inadmissibility, according to your immigration status, as well as a description of your inadmissibility in your own words;
• information on your previous stays in the US; 
• information on your relative through whom you are claiming eligibility; 
• information on your other relatives in the US;
• applicants with class A tuberculosis have an additional part of the form both they and the representative of a health facility in the US need to fill out. 
Both you, as the applicant, and the person who prepared the form, need to sign it. Preparer of the form also needs to provide some personal information. You'll have to answer all of the questions twice in the form. 



